-- Name: updatetotaldonations(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.updatetotaldonations() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    UPDATE participants
    SET totalDonations = (
        SELECT COALESCE(SUM(donationAmount), 0)
        FROM donations
        WHERE participantId = NEW.participantId
    )
    WHERE participantId = NEW.participantId;
    RETURN NEW;
END;
$$;


